import React from 'react';

function Search() {
  const plants = [
    { name: "Aloe Vera", image: "https://via.placeholder.com/150", price: "$25" },
    { name: "Snake Plant", image: "https://via.placeholder.com/150", price: "$40" },
    { name: "Peace Lily", image: "https://via.placeholder.com/150", price: "$35" },
    { name: "Spider Plant", image: "https://via.placeholder.com/150", price: "$20" },
    { name: "Cactus", image: "https://via.placeholder.com/150", price: "$15" },
    { name: "Fern", image: "https://via.placeholder.com/150", price: "$30" },
    { name: "Bamboo Palm", image: "https://via.placeholder.com/150", price: "$45" },
    { name: "Money Plant", image: "https://via.placeholder.com/150", price: "$25" },
    { name: "Jade Plant", image: "https://via.placeholder.com/150", price: "$50" },
  ];

  return (
    <div className="container mt-5">
      <h3 className="text-center text-success mb-4">Search Plants</h3>
      <div className="row">
        {plants.map((plant, index) => (
          <div key={index} className="col-md-4 mb-4">
            <div className="card h-100 shadow-sm">
              <img src={plant.image} alt={plant.name} className="card-img-top" />
              <div className="card-body text-center">
                <h5>{plant.name}</h5>
                <p>{plant.price}</p>
                <button className="btn btn-success">Order</button>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Search;
